	// convenient 'inline' use of g_variant_new(), e.g.:
	//
	//     g_dbus_proxy_call_sync (proxy,
	//                             "TwoStrings",
	//                             g_variant_new ("(ss)",
	//                                            "Thing One",
	//                                            "Thing Two"),
