	// amounts of data), if G_SUBPROCESS_FLAGS_STDOUT_PIPE or
	// G_SUBPROCESS_FLAGS_STDERR_PIPE were used, reads from those streams. The
	// data that was read is returned in @stdout and/or the @stderr.
