	// subprocesses not created with G_SUBPROCESS_FLAGS_STDOUT_PIPE, @stdout_buf
	// will be set to nil. Similar provisions apply to @stderr_buf and
	// G_SUBPROCESS_FLAGS_STDERR_PIPE.
